function keyCode(input) {
// keypad layout:
//     1
//   2 3 4
// 5 6 7 8 9
//   A B C
//     D

  var keypad = {
    '1': '2,2',
    '2': '1,1',
    '3': '2,1',
    '4': '3,1',
    '5': '0,0',
    '6': '1,0',
    '7': '2,0',
    '8': '3,0',
    '9': '4,0',
    'A': '1,-1',
    'B': '2,-1',
    'C': '3,-1',
    'D': '2,-2'
  }

  var position = [0, 0];
  var instruction;
  var code = [];
  var stringPosition;


  for (var line of input) {
    instruction = line.split('');
    for (var step of instruction) {
    stringPosition = position.join();
      switch (step) {
        case 'R':
          if (stringPosition === keypad['1'] ||
              stringPosition === keypad['4'] ||
              stringPosition === keypad['9'] ||
              stringPosition === keypad['C'] ||
              stringPosition === keypad['D']) {
            break;
          } else {
            position[0] += 1;
            break;
          }
        case 'L':
          if (stringPosition === keypad['1'] ||
              stringPosition === keypad['2'] ||
              stringPosition === keypad['5'] ||
              stringPosition === keypad['A'] ||
              stringPosition === keypad['D']) {
            break;
          } else {
            position[0] -= 1;
            break;
          }
        case 'U':
          if (stringPosition === keypad['5'] ||
              stringPosition === keypad['2'] ||
              stringPosition === keypad['1'] ||
              stringPosition === keypad['4'] ||
              stringPosition === keypad['9']) {
            break;
          } else {
            position[1] += 1;
            break;
           }
        case 'D':
          if (stringPosition === keypad['5'] ||
              stringPosition === keypad['A'] ||
              stringPosition === keypad['D'] ||
              stringPosition === keypad['C'] ||
              stringPosition === keypad['9']) {
            break;
          } else {
            position[1] -= 1;
            break;
          }
      }
    }

    var stringPosition2 = position.join();

    for (var value in keypad) {
      if (keypad[value] === stringPosition2) {
        code.push(value)
      }
    }
  }

  console.log(code);
}

var input = [
  '',
  '',
  '',
  '',
  ''
]

keyCode(input);

